import React, { useRef } from "react";
import usersData from "./usersData";

const Users1 = () => {
    const currentIndex = useRef(0);
    const users = {
        user: usersData[currentIndex.current]
    };

    const infoUsers = () => {
        const Card = document.getElementsByClassName('Card');
        currentIndex.current = (currentIndex.current + 1) % usersData.length;
        Card.user = usersData[currentIndex.current];
    }

    return (
        <div>
            <button id='ButtonUsers' onClick={() => infoUsers()}>USERS</button>
            <div className="Card">
                <ul>
                    <li>{users.user.name}</li>
                    <li>{users.user.age}</li>
                    <li>{users.user.email}</li>
                </ul>
            </div>
        </div>
    );
}

export default Users1;
